import React from 'react';





function SubmitButton(props){
    return (
        <span className="btn btn-warning submit-btn" {...props} role="button" tabIndex="0" onClick={(e) => props.savedata()}>
          Submit Button
        </span>
      );

}

export default SubmitButton;
